import {Fragment, useState} from 'react';
import Box from "@mui/material/Box";
import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import HelpIcon from '@mui/icons-material/Help';
import Toolbar from '@mui/material/Toolbar';
import Switch from '@mui/material/Switch';


function Home(){
    const [cardSwitch, setCardSwitch] = useState(true);

    const handleCardSwitch = (event) => {
        setCardSwitch(event.target.cardSwitch);
    }

    return(
        <Fragment>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar 
                    position="static" 
                    sx={{
                        backgroundColor: 'rgb(50,53,60)'
                    }} 
                >
                    {/* Possibly change to image of logo instead */}
                    <Toolbar>
                        <Box
                            align='left'
                            sx={{width:140}}
                        >
                            <Typography
                                variant="h6"
                                noWrap
                                sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
                            >
                                MealsFromDirt
                            </Typography>  
                        </Box>

                        <IconButton color='primary' > 
                            <HelpIcon fontSize='large' />
                        </IconButton>

                        <Switch
                            cardSwitch={cardSwitch}
                            onChange={handleCardSwitch}

                        />

                   </Toolbar>   
                </AppBar>

                <Box
                    sx={{
                        border: '1px solid black',
                    }}
                >
                    Card Holder
                </Box>

            </Box>


            <Box>
                Image
            </Box>
            <Box>
                Text Bar Input
            </Box>
            <Box>
                Enter Button
            </Box>
        </Fragment>
    )
}

export default Home;
